import React from "react";
import styled from "styled-components";
import MNButton from "../ui/menuBT";
import Template from "../ui/template";



const MainTitleText = styled.p`
    font-size: 40px;
    font-weight: 900;
    text-align: center;
    color: #FFFFFF;
    letter-spacing: 2px;
    position: absolute;
    width: 241px;
    height: 58px;
    left: 23px;
    top: 27px;
`;



function Writepage(props) {

    return (
        <Template>
            <MainTitleText>알쏭달쏭?!</MainTitleText>
                <p><MNButton title="카테고리" /></p>
                <MNButton title="누가" />
                <MNButton title="언제" />
                <MNButton title="무엇을" />
                <MNButton title="내용" />
                <MNButton title="링크" />
                <MNButton title="중요도" />
        </Template>
           
       
    );
}

export default Writepage;
